Scheme_Object *scheme_reload(Scheme_Env *env) {
  Scheme_Env *menv = SWIG_MZSCHEME_CREATE_MENV(env);
  
  SWIG_InitializeModule((void *) env);
  
  scheme_add_global("set-something", scheme_make_prim_w_arity(_wrap_set_something,"set-something",2,2),menv);
  scheme_add_global("get-something", scheme_make_prim_w_arity(_wrap_get_something,"get-something",1,1),menv);
  
  return scheme_void;
}
Scheme_Object *scheme_initialize(Scheme_Env *env) {
  return scheme_reload(env);
}
Scheme_Object *scheme_module_name(void) {
  return scheme_make_symbol((char*)"foomod");
}

